import React from "react";

const ExpenseDate = (props) => {
  const month = props.toLocaleString("en-US", { month: "long" });
  const year = props.getFullYear();
  const day = (
    <div>
      <div>{month}</div>
      <div>{year}</div>
      <div>{day}</div>
    </div>
  );
  return <div>ExpenseDate</div>;
};

export default ExpenseDate;
